import React, { useState, useEffect } from "react";
import Header from "../partials/Header";
import Footer from "../partials/Footer";
import { MDBInput, MDBCol } from "mdbreact";
import DiscoverMultiCarousel from "../partials/Discover/DicoverMultiCarousel";

function CuratedBrands() {
    const [search ,setSearch] = useState("");

  return (
    <>
      <div className="flex flex-col min-h-screen overflow-hidden">
        <Header />
        <div>
          <div className="max-w-8xl  text-center mt-32 mx-auto px-4 sm:px-6">
            {/* Top area: Blocks */}
            <div className=" gridsm:grid-cols-12 gap-8 py-20 md:py-12">
              <h1 className="font-extrabold text-black">CURATED BRANDS</h1>
            </div>
          </div>
        </div>
        <div>
          <div className="max-w-6xl  text-center  mt-24 mx-auto px-4 sm:px-6">
            {/* Top area: Blocks */}
            <div>
              <MDBCol md="12">
                <MDBInput
                  hint="Search..."
                  type="text"
                  style={{
                    borderTop: "none",
                    borderRight: "none",
                    borderLeft: "none",
                  }}
                  containerClass="active-pink active-pink-2 mt-0 mb-3"
                />
              </MDBCol>
            </div>
          </div>

          <DiscoverMultiCarousel />
        </div>

        <Footer />
      </div>
    </>
  );
}
export default CuratedBrands;
